import {Colors} from './Colors';

const DarkTheme = {
  type: 'dark',
  keyboardAppearance: 'dark',
  theme: Colors.primary,
  background: Colors.black,
  shadowColor: Colors.gray2,
  card: Colors.gray5,
  text: Colors.white,
  lightText: Colors.lightGray6,
  border: Colors.gray4,
  tint: Colors.black,
  statusBar: 'light-content',
  red: 'red',
};

export default DarkTheme;
